  false,\n\t\"url\": null,\n\t\"notes\": \"The overall objective is to familiarize
  participating scientists with PISCES multibeam echosounder (Simrad ME70) configuration,
  operation, calibration and data collection and test the sonar's capabilities for
  a variety of applications. An additional objective is to collect water column and
  seafloor scattering data using PISCES multibeam echosounder and splitbeam echosounders
  (Simrad EK60) in coordination with measurements being conducted on OKEANOS EXPLORER
  using Simrad EM302 multibeam echosounder for comparison between systems.\",\n\t\"license_title\":
